import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Benjamin Flanders</h1>
      <p>704-222-4234</p>
      <p>January 25th, 1996</p>
      <p>benjamin.flanders96@gmail.com</p>
    </div>
  );
}

export default App;
